.devices {
  &___background {
    position: relative;
    width: 100%;
    height: 100%;
    background: url("@{img}devices-background.png");
    padding: 42px 0 57px 0;

    &::before {
      content: "";
      position: absolute;
      top: 0;
      width: 100%;
      height: 100%;
      background-color: @white-backgroud-color;
    }
  }

  &___wrapper {
    position: relative;
    z-index: 2;
  }

  &__header {
    text-align: center;
    padding-bottom: 59px;
  }

  &__headline {
    padding: 18px 0;

    & h3 {
      font-family: "Kaushan Script";
      font-weight: 400;
      font-size: 30px;
      line-height: 44px;
    }
  }

  &__title {
    padding: 19.5px 0 37px 0;

    & h2 {
      font-weight: 900;
      font-size: 36px;
      line-height: 42px;
      text-transform: uppercase;
    }
  }
}

.gadgets {
  position: relative;

  &__wrap {
    padding: 15px 0;
  }

  &__image-tablet {
    margin: 0 auto;
    max-width: 659px;
  }

  &__image-frame {
    background: url("@{img}devices-frame.png");
    position: absolute;
    top: 0;
    width: 100%;
    height: 100%;
  }

  &__image-phone {
    background: url("@{img}devices-phone.png");
    position: absolute;
    bottom: -19%;
    right: 200px;
    width: 200px;
    height: 411px;
  }
}

sources.style\\service.less:
.service {
  &__wrapper {
    padding: 42px 0 114px 0;
  }

  &__header {
    text-align: center;
  }

  &__headline {
    padding: 18px 0;

    & h3 {
      font-family: @Kaushan-Script;
      font-weight: 400;
      font-size: 30px;
      line-height: 44px;
      color: @Shark-color;
    }
  }

  &__title {
    padding: 19.5px 0 42px 0;

    & h2 {
      font-weight: 900;
      font-size: 36px;
      line-height: 42px;
      text-transform: uppercase;
      color: @Shark-color;
    }
  }

  &__text {
    padding: 38px 0 80px 0;

    & h5 {
      font-weight: 400;
      font-size: 18px;
      line-height: 21px;
    }
  }

  &__content {
    display: grid;
    grid-template-columns: 1fr 1fr;
    grid-column-gap: 30px;

    .service__image-inner {
      height: 100%;
      max-height: 483px;

      & img {
        height: 100%;
      }
    }
  }

  .accordion {
    &__item {
      border: 1px solid @Silver-Sand-color;
      margin-bottom: 22px;

      &_active {
        .accordion__description {
          border-bottom: 1px solid @Silver-Sand-color;
        }
        .accordion__content {
          height: 127px;
          margin: 18px 24px 18px 0;
        }
      }
    }

    &__description {
      display: flex;
      align-items: center;
      cursor: pointer;
      border-bottom: 1px solid transparent;
      transition: all 0.7s ease;

      &:hover {
        background-color: @Wild-Sand-solid-color;
      }
    }

    &__content {
      height: 0;

      overflow-y: scroll;
      transition: all 0.7s ease-in-out;

      &::-webkit-scrollbar {
        background-color: @Wild-Sand-color;
        width: 7px;
      }

      &::-webkit-scrollbar-thumb {
        background-color: @Morning-Glory-color;
      }
    }

    &__icon {
      padding: 0 40px 0 18px;
    }

    &__title {
      padding: 31px 0;

      & h4 {
        font-weight: 700;
        font-size: 24px;
        line-height: 28px;
        text-transform: uppercase;
        color: @Shark-color;
      }
    }

    &__text {
      padding: 0 54px 0 22px;

      & h5 {
        font-weight: 400;
        font-size: 18px;
        line-height: 21px;
        color: @Shark-color;
      }
    }

    &__arrows {
      margin-left: auto;
      padding-right: 14px;

      &-wrap {
        width: 42px;
        height: 42px;
        padding-top: 5px;
        display: flex;
        flex-direction: column;
        align-items: center;
      }
    }

    &__arrow-btn {
      width: 30px;
      height: 20px;
      cursor: pointer;
      background: url("@{icon}arrow.svg");

      &_active {
        background: url("@{icon}arrow-active.svg");
      }
    }
  }
}
